import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import { Card, Typography, Space, Spin, Alert } from "antd";
import "antd/dist/antd.css";

const { Title, Text } = Typography;

function PatientDashboard() {
    const location = useLocation();
    const [healthData, setHealthData] = useState([]);
    const [patientProfile, setPatientProfile] = useState(location.state?.patientProfile || {});
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState("");

    const patientId = location.state?.patientProfile?.id || "123"; // Dynamically retrieve ID

    useEffect(() => {
        if (!patientId) {
            setError("Aucun ID patient trouvé !");
            return;
        }

        setLoading(true);
        setError("");

        // Fetch health data
        axios
            .get(`http://localhost:8080/api/health-data/${patientId}`)
            .then((response) => {
                setHealthData(response.data);
                setLoading(false);
            })
            .catch((error) => {
                setError("Erreur lors de la récupération des données de santé.");
                setLoading(false);
            });
    }, [patientId]);

    return (
        <div style={styles.dashboard}>
            {/* Profile Section */}
            <Card style={styles.card} bordered={false}>
                <Title level={3} style={styles.cardTitle}>Profil du Patient</Title>
                <Space direction="vertical" size="middle">
                    <Text strong>Nom : {patientProfile.name || "Nom indisponible"}</Text>
                    <Text strong>Email : {patientProfile.email || "Email indisponible"}</Text>
                    <Text strong>
                        Date de naissance :{" "}
                        {patientProfile.birthDate
                            ? new Date(patientProfile.birthDate).toLocaleDateString()
                            : "Non spécifiée"}
                    </Text>
                </Space>
            </Card>

            {/* Health Reports Section */}
            <div style={styles.section}>
                <Title level={3}>Rapports de Santé</Title>
                {loading && <Spin size="large" style={{ display: "block", margin: "20px auto" }} />}
                {error && <Alert message={error} type="error" showIcon style={{ marginBottom: "20px" }} />}
                {healthData.length > 0 ? (
                    <Space direction="vertical" size="large" style={{ width: "100%" }}>
                        {healthData.map((data, index) => (
                            <Card key={index} style={styles.card} bordered={false}>
                                <Text>
                                    <strong>Date enregistrée : </strong>
                                    {new Date(data.date_recorded).toLocaleDateString()}
                                </Text>
                                <br />
                                <Text>
                                    <strong>Type : </strong>{data.type}
                                </Text>
                                <br />
                                <Text>
                                    <strong>Valeur : </strong>{data.value}
                                </Text>
                            </Card>
                        ))}
                    </Space>
                ) : (
                    !loading && <Text>Aucune donnée de santé disponible.</Text>
                )}
            </div>
        </div>
    );
}

const styles = {
    dashboard: {
        padding: "20px",
        backgroundColor: "#f4f4f4",
        minHeight: "100vh",
    },
    section: {
        marginTop: "30px",
    },
    card: {
        backgroundColor: "#fff",
        borderRadius: "10px",
        padding: "20px",
        boxShadow: "0 4px 20px rgba(0, 0, 0, 0.1)",
    },
    cardTitle: {
        color: "#4a4a4a",
    },
};

export default PatientDashboard;
